import App from "../src/components/App";
import { Fragment } from "react";
import Link from "next/link";

const Index = () => {
  return (
    <Fragment>
      <App />
      <Link href={`/profile?slug=`}>
        <a>Profile</a>
      </Link>
    </Fragment>
  );
};

export default Index;
